import React from 'react';
import '../styles/Global.css';

const Footer = () => {
    return (
        <footer className="rodape">
            <p className="rodape_texto">© 2025 Caça-Preço. Todos os direitos reservados.</p>
            <div className="rodape_links">
                <a href="#" className="rodape_link">Privacidade</a>
                <a href="#" className="rodape_link">Termos</a>
                <a href="#" className="rodape_link">Contato</a>
            </div>
        </footer>
    );
};

export default Footer;
